import React, { Fragment } from 'react';
import { Helmet, HelmetProvider } from "react-helmet-async";

function BasicInfo() {
  return (
    <Fragment>
    <HelmetProvider>
      <Helmet>
        <title> Basic Info | Zom - IN </title>
      </Helmet>
    </HelmetProvider>
    <div id="signUp" className="signUp">
    </div>
    </Fragment>
  )
}

export default BasicInfo;
